const App = () => {
  const name = null;
  const isNameShowing = true;

  return (
    <div className="App">
      <h1>Hello World </h1>
      {name ? (
        <>
        <h1>{name}</h1>
        </>
      ):(<>
        <h1>Test</h1><h2>ThereIsNoaname</h2>
        </>
      )}
    </div>
  );
}

export default App;
